import { NavLink } from 'react-router-dom';
import { _Card } from '../../stl-cmp';

const CardCan = ({ id, name, picture, temp, weight, height, yearsOfLife }) => {
	const [ minHeight, maxHeight ] = height.split(' - ');
	const [ minWeight, maxWeight ] = weight.split(' - ');
	// const _temp = temp.split(', ')
	const [ minYears, maxYears ] = yearsOfLife.slice(0, 7).split(' - ');
	return (
		<_Card>
			<div className="img">
				<img src={picture} alt={name} />
			</div>
			<div className="desc">
				<h3>{name}</h3>
				<p className="height">
					<p>Altura</p> 
					<div>
						<p>{`min: ${minHeight}cm`}</p>
						<p>{`max: ${maxHeight}cm`}</p>
					</div>
				</p>
				<p className="height">
					Peso
					<div>
						<p>{`min: ${minWeight}kg`}</p>
						<p>{`max: ${maxWeight}kg`}</p>
					</div>
				</p>
				<p className="weight">{'min:' + minWeight + ' kg - ' + 'max:' + maxWeight + ' kg'}</p>
				<p className="years">{'min:' + minYears + ' years - ' + 'max:' + maxYears + ' years'}</p>
				<p className="temps">
					<p>Temperamentos:</p> {temp.map((e) => <b>{e}</b>)}
				</p>
				<button className="add">AÃ±adir cachorro</button>
				<button className="details">
					<NavLink to={`${id}`}>Ver Detalles</NavLink>
				</button>
			</div>
		</_Card>
	);
};

export default CardCan;
